', '', '', '', '', '', '', '', '', '2065', '1', '<div>Intervensi mandiri :</div><div>Identifikasi lokasi, karakteristik, durasi, frekuensi, kualitas, intensitas nyeri, Identifikasi skala nyeri, Berikan teknik nonfarmakologis untuk mengurangi rasa nyeri, Monitor karakteristik luka (mis:drainase,warna,ukuran,bau, Monitor tanda tanda infeksi, Pertahan kan teknik seteril saaat perawatan luka,monitor lab (Hb), kolaborasi pemberian tranfusi</div><div>Intervensi kolaborasi :</div><div>- post tranfusi PRC 1 bag di ok thl 17/1/2025</div><div>- perdarahan di ok kurang lebih 200 cc</div><div>- boleh makan / minum bila sudah sadar penuh</div><div>- analgetik di ICU ketorolac 3x30mg bila masih nyeri dapat di tambahkan paracetamol inf 3x1 gr (k/p)==) dr tri Sp. An</div><div>- R/ tranfusi PRC 2 bag perhari, target Hb > 10 gr/dl , Ca gluconas 1 amp extra setiap 4 bag PRC</div><div><br></div>', NULL, '2065', 0, NULL, '2025-01-17 22:51:04')
